import React, { useEffect, useState } from 'react';
import axios from 'axios';
import styled, { keyframes, css } from 'styled-components';
import Logo from '../../WhiteLogo.PNG';

const fadeIn = keyframes`
  from {
    opacity: 0;
    transform: translateY(10px);
  }
  to {
    opacity: 1;
    transform: translateY(0);
  }
`;

const PageContainer = styled.div`
  background-color: #1e1e1e;
  min-height: 100vh;
  font-family: 'Roboto', sans-serif;
  padding: 20px;
  animation: ${fadeIn} 1s ease-in-out;
`;

const LoadingText = styled.div`
  margin-top: 20px;
  font-size: 24px;
  color: #ffffff;
  text-align: center;
  animation: ${fadeIn} 1s ease-in-out;
`;

const ButtonContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  height: 100vh;
`;

const LogoButton = styled.button`
  background-color: transparent;
  border: 4px solid #ffffff;
  border-radius: 15px;
  padding: 20px;
  cursor: pointer;
  display: flex;
  justify-content: center;
  align-items: center;
  width: 150px;
  height: 150px;
  transition: transform 0.3s ease;
  &:hover {
    transform: scale(1.1);
  }
`;

const LogoImage = styled.img`
  width: 50px;
  height: 50px;
`;

const CubeContainer = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  flex-wrap: wrap;
  width: 320px;
  height: 320px;
  position: relative;
`;

const Flex = styled.div`
  display: flex;
  justify-content: center;
  align-items: center;
  width: 80px;
  height: 80px;
  margin: 0 -80px 0 0;
`;

const Cube = styled.div`
  position: relative;
  width: 1px;
  height: 1px;
  margin: 0 80px 0 0;
  transform-style: preserve-3d;
`;

const Wall = styled.div`
  width: 80px;
  height: 80px;
  position: absolute;
  left: calc(-80px / 2);
  top: calc(-80px / 2);
  text-align: center;
  line-height: 100px;
  border: solid 1px #fff;
  background-color: transparent;
  ${props => props.face && css`
    transform: ${props.face === 'front' ? 'translateZ(40px)' :
                props.face === 'back' ? 'translateZ(-40px) rotateY(180deg)' :
                props.face === 'left' ? 'translateX(-40px) rotateY(-90deg)' :
                props.face === 'right' ? 'translateX(40px) rotateY(90deg)' :
                props.face === 'top' ? 'translateY(-40px) rotateX(90deg)' :
                'translateY(40px) rotateX(-90deg)'};
  `}
`;

const animationDelay = [0.5, 0.6, 0.7, 0.8, 0.9, 1, 1.1];

const rotation = keyframes`
  100% {
    transform: rotateX(270deg) rotateY(270deg);
  }
`;

const colorChange = keyframes`
  100% {
    background-color: #fff;
  }
`;

const CubeAnimated = styled(Cube)`
  ${props => props.index && css`
    animation: ${rotation} 3s cubic-bezier(0.215, 0.61, 0.355, 1) ${animationDelay[props.index - 1]}s forwards;
    & .wall {
      animation: ${colorChange} 2s linear 1.5s forwards;
    }
  `}
`;

export const SOTD = () => {
  const [data, setData] = useState(null);
  const [contentLoaded, setContentLoaded] = useState(false);
  const [activeTab, setActiveTab] = useState('Day Trading');
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    if (loading) {
      axios
        .get('http://localhost:5001/api/filtered_stocks')
        .then((response) => {
          console.log('Fetched Data:', response.data);
          setData(response.data);
          setContentLoaded(true);
        })
        .catch((error) => {
          console.log('ERROR:', error);
        });
    }
  }, [loading]);

  console.log('State Data:', data);

  return (
    <PageContainer>
      {!contentLoaded ? (
        !loading ? (
          <ButtonContainer>
            <LogoButton onClick={() => setLoading(true)}>
              <LogoImage src={Logo} alt="Logo" />
            </LogoButton>
          </ButtonContainer>
        ) : (
          <div style={{ display: 'flex', flexDirection: 'column', alignItems: 'center' }}>
            <CubeContainer>
              {[...Array(4)].map((_, rowIndex) => (
                <Flex key={rowIndex}>
                  {[...Array(4)].map((_, cubeIndex) => (
                    <CubeAnimated key={cubeIndex} index={rowIndex * 4 + cubeIndex + 1}>
                      {['front', 'back', 'left', 'right', 'top', 'bottom'].map((face, faceIndex) => (
                        <Wall key={faceIndex} face={face} />
                      ))}
                    </CubeAnimated>
                  ))}
                </Flex>
              ))}
            </CubeContainer>
            <LoadingText>Loading...</LoadingText>
          </div>
        )
      ) : (
        <div>
          <TabContainer>
            <TabButton active={activeTab === 'Day Trading'} onClick={() => setActiveTab('Day Trading')}>Day Trading</TabButton>
            <TabButton active={activeTab === 'Swing Trading'} onClick={() => setActiveTab('Swing Trading')}>Swing Trading</TabButton>
            <TabButton active={activeTab === 'Long Term'} onClick={() => setActiveTab('Long Term')}>Long Term</TabButton>
          </TabContainer>
          {/* Rest of the content */}
        </div>
      )}
    </PageContainer>
  );
};
